import React from 'react';

import MealsSummary from './MealsSummary';
import AvailableMeals from './AvailableMeals';

const Meals = (props) => {
    return (
        <React.Fragment>
            <MealsSummary/>
            <AvailableMeals showModal={props.showModal} setShowModal={props.setShowModal}/>
        </React.Fragment>
    )
}

export default Meals;
